Appreciate chopping up depression with my guys on @thepivot. I’ve worked hard over the years to gain the emotional tools to work thru any mental pain that may come to test me. But years ago I didn’t know what mental health struggle was. As men, we didn’t talk about it. We just kept our head down and worked thru it. Not healthy but it’s all we knew. 


If you’re going thru your own version of mental wellness turning into mental hell-ness, the most important thing you can do is talk to somebody. 

It can’t be fixed if you keep that pain inside. 

Having the courage to talk to someone is your superpower. I lost two friends to suicide. 

Talk to someone. Despite how you may feel, you’re never alone. 

